import React, { Component } from 'react'

export default class PhoneInfo extends Component {
    static defaultProps = {
        info : {
            name : '이름',
            phone : '010-1234-5678',
            id: 0
        }
    }
    render() {
        const style = {
            border : '1px solid #000',
            padding : '8px',
            margin : '8px'
        }
        const {name, phone, id} = this.props.info;
        if({name} === '히준'){
            console.log("my name ",{name});
            return;
        }
        return (
            <div style={style}>
                <div><b>{name}</b></div>
                <div>{phone}</div>
            </div>
        )
    }
}
